INSERT INTO `posts` (`author_id`, `title`, `description`, `content`, `date`) VALUES (1, 'Eum dolorem quo non rerum eligendi voluptatem qui.', 'Nihil deleniti voluptatem harum. Consectetur odio veniam nihil iste assumenda velit. Molestias placeat numquam facere corrupti porro. Maxime temporibus nobis exercitationem velit reprehenderit illum dolor sit.', 'Autem rerum et ea iure ut molestias accusantium. Velit culpa deleniti et quasi voluptate sed. Quae alias praesentium nostrum qui sint porro.', '2015-01-12');
INSERT INTO `posts` (`author_id`, `title`, `description`, `content`, `date`) VALUES (2, 'Ut molestias consectetur nobis error.', 'Sint et eius tempora. Odit voluptate dicta sunt omnis minima quia atque. Placeat fuga quis sit accusamus nam sunt sit. Labore at voluptatibus nihil et nesciunt minus fugit.', 'Tempore excepturi odio dolorum labore. Necessitatibus culpa et culpa magnam. Esse laboriosam quibusdam reiciendis dicta repudiandae voluptatem dolorem.', '1975-12-21');
INSERT INTO `posts` (`author_id`, `title`, `description`, `content`, `date`) VALUES (3, 'Consequatur iste odit consequatur.', 'Architecto ab est sed aperiam. Corrupti vitae quasi culpa temporibus. Rerum rerum et repellendus exercitationem incidunt.', 'Neque mollitia ipsam voluptatem sed inventore aut atque facilis. Cupiditate exercitationem sit nihil qui. Nihil accusantium enim qui ab et.', '1981-07-09');
INSERT INTO `posts` (`author_id`, `title`, `description`, `content`, `date`) VALUES (4, 'Corporis cum et mollitia praesentium error enim ut incidunt.', 'Quo ipsa laboriosam doloremque aut excepturi qui distinctio. Ullam ducimus excepturi iure officia. Corporis atque unde repudiandae alias laudantium modi. Accusantium aut iure sed.', 'Voluptatem enim exercitationem et voluptate odio. Eaque unde a nesciunt eaque et nam. Est sapiente alias quidem perspiciatis repellat consequuntur sunt qui. Consequatur ut magnam aut.', '1981-12-08');
